import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHtml5, faCss3Alt, faSass, faJsSquare, faGithubSquare, faJava } from '@fortawesome/free-brands-svg-icons';
import styles from "./SkillsList.module.scss";

export const SkillsList = () => {

  function startAnimation(o) {
    var hue = 'rgb('
        + (Math.floor(Math.random() * 256)) + ','
        + (Math.floor(Math.random() * 256)) + ','
        + (Math.floor(Math.random() * 256)) + ')';
    $(o.currentTarget).animate( { color: hue }, 500, function() {
        startAnimation(o);
    });
}

$(document).ready(function() {
    $('a').hover(
        startAnimation,
        function() {
            $(this).stop().animate( { color: '#000' }, 500);
        }
    );
});

  return (
    <div className={styles.skills}>
      <div className={styles.skills__icon}>
      <FontAwesomeIcon icon={faHtml5} size="4x" className={styles.skills__icon_shadow}/>
      </div>
      <div className={styles.skills_list_icon}>
      <FontAwesomeIcon icon={faCss3Alt} size="4x" />
      </div>
      <div className={styles.skills_list_icon}>
      <FontAwesomeIcon icon={faSass} size="4x" />
      </div>
      <div className={styles.skills_list_icon}>
      <FontAwesomeIcon icon={faJsSquare} size="4x" />
      </div>
      <div className={styles.skills_list_icon}>
      <FontAwesomeIcon icon={faGithubSquare} size="4x" />
      </div>
      <div className={styles.skills_list_icon}>
      <FontAwesomeIcon icon={faJava} size="4x" />
      </div>
      {/* <div className={styles.skills_list_icon}>
      <FontAwesomeIcon icon={faJava} size="4x" />
      </div> */}
    </div>
  );
};
